q38_1_mostly_positive_changes:
Clean and tidy; litter free;
 Better digital access to library and Council online service;
 Well-connected with various communities through the City’s What’s On outlets, e.g. virtual walks, gentle exercises, virtual art gallery museum, et al.
 Letter box drop about City’s News and Covid undertakings of accelerated capital works, support to art and businesses, et al.
 City’s ongoing connection and consultations

having to rethink as a society what we are doing and why; 
 society-wide examination of what jobs and activities are of true value; 
 staying home if you are displaying signs of a communicable respiratory illness (no more 'soldiering on' and infecting others in work and public areas); 
 a move back to more people valuing scientific method, reputable information sources and expert advice; 
 increase in social responsibility and recognition/promotion of the common good; 
 kindness, compassion, patience and greater courtesy coming to the behavioural forefront (successful social distancing requires the display of good manners)
